import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import AddTask from './components/AddTask/Form';
// import Task from './components/Task/task';
import DoingList from './components/Lists/Doing';
import DoneList from './components/Lists/Deleted';
import DeletedList from './components/Lists/Done';
export const MyContext = React.createContext({ data: [] });
const App = props => {
    return (
        <>
            <MyContext.Provider value={{data:[]}}>
                <AddTask />
                {/* <Task /> */}
                <DoingList />
                <div style={{ display: 'flex' }}>
                    <DeletedList />
                    <DoneList />
                </div>
            </MyContext.Provider>
        </>
    )
}



export default App;
